	module.exports = "\n<div _v-010d07c4=\"\">\n    <accordion :min=\"false\" :text=\"'关于借款'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'如何在今借到借款?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div style=\"text-indent: 0em;\" _v-010d07c4=\"\">根据不同场景，我们为您提供了以下3种借款⽅式：</div>\n                <div class=\"title\" _v-010d07c4=\"\">1、补借条</div>\n                <div _v-010d07c4=\"\">对于已经发⽣的借款，点击⾸⻚下⽅【补借条】，选择您的出借⼈/借款⼈⾝份，输 ⼊借款⾦额、借款⽇期、还款⽇期、年化利率，注明借款⽤途及对⽅姓名，然后发送给对⽅，对⽅在3天内确认即可⽣成电⼦借条；</div>\n                <div class=\"title\" _v-010d07c4=\"\">2、求借款</div>\n                <div _v-010d07c4=\"\">对于尚未发⽣的借款，点击⾸⻚下⽅【求借款】，输⼊借款⾦额、还款⽅式、还款\n                     ⽇期/分期次数、年化利率、服务费、是否需要担保⼈及担保费率，注明借款⽤途以 及是否公开求借款，即可成功发布，您指定的平台好友即可在⾸⻚的【借款标的】⾥看到您的借款信息，筹款时间最⻓持续3天，此外，您还可以主动邀请平台外好 友作担保/出借，以提⾼效率；</div>\n                <div class=\"title\" _v-010d07c4=\"\">3、申请贷款</div>\n                <div _v-010d07c4=\"\">您还可以向专业放贷⼈⼠申请固定的贷款产品，点击⾸⻚的【贷款产品】，⽐较并选择您适合的贷款产品，查看详情，点击【⻢上申请】，输⼊借款⾦额、还款⽇期/分期次数、借款⽤途，并完善出借⼈要求的信⽤资料，即可提交申请，出借⼈会在3天内做出反馈；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'借款有什么限制?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div class=\"title\" _v-010d07c4=\"\">借款额度</div>\n                <div _v-010d07c4=\"\">单笔⾦额不超过20万元，个⼈在平台的借款余额不超过20万元；</div>\n                <div class=\"title\" _v-010d07c4=\"\">借款次数</div>\n                <div _v-010d07c4=\"\">同⼀时间段内，只能发起⼀个求借款；可以申请多个贷款产品，但是⼀个贷款通过申请后，其它贷款订单⾃动关闭；补借条不限制次数；</div>\n                <div class=\"title\" _v-010d07c4=\"\">费⽤情况</div>\n                <div _v-010d07c4=\"\">利息=借款⾦额*(0%-24%),由发起⽅决定；</div>\n                <div _v-010d07c4=\"\">担保费=担保⾦额*(0%-10%),由发起⽅决定；</div>\n                <div _v-010d07c4=\"\">服务费=借款⾦额*（0%/10%/20%）,最低服务费不超过借款⾦额的20%,于出借⼈⽀付成功后，平台直接扣除；</div>\n                <div _v-010d07c4=\"\">⼿续费=借款⾦额*1%，于出借⼈⽀付成功后，平台直接扣除；</div>\n                <div class=\"title\" _v-010d07c4=\"\">借款时⻓</div>\n                <div _v-010d07c4=\"\">借款时⻓最⻓为1年，分期次数有3/6/12三种选择；</div>\n                <div class=\"title\" _v-010d07c4=\"\">还款⽅式</div>\n                <div _v-010d07c4=\"\">求借款和贷款⽀持到期还本付息和等额本息两种，补借条仅⽀持到期还本付息；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'如何提⾼借款速度？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、适当提⾼年化利率/服务费/担保费，彰显诚意；</div>\n                <div _v-010d07c4=\"\">2、借款⽤途中提供有说服⼒的理由和证据；</div>\n                <div _v-010d07c4=\"\">3、对于求借款，发送⼆维码，主动邀请平台外好友作担保/出借；</div>\n                <div _v-010d07c4=\"\">4、完善⾃⼰的信⽤报告，提升信⽤值；</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'关于放贷'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'如何在今借到放贷?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div style=\"text-indent: 0em;\" _v-010d07c4=\"\">根据不同场景，我们为您提供了以下3种出借⽅式：</div>\n                <div class=\"title\" _v-010d07c4=\"\">1、放贷款</div>\n                <div _v-010d07c4=\"\">点击⾸⻚下⽅【放贷款】-【添加新产品】，输⼊借款⾦额范围、借款时 ⻓范围、还款⽅式、年化利率、服务费率及最低额度，选择借款⼈必填的 信⽤资料，添加补充说明，即可发布成功，您的好友可以在⾸⻚的【贷款产品】⾥看到您的产品，此外，您还可以主动分享贷款产品给平台外的客户；</div>\n                <div class=\"title\" _v-010d07c4=\"\">2、求借款-借给TA</div>\n                <div _v-010d07c4=\"\">点击⾸⻚的【借款标的】，⽐较并选择适合您的借款标的，查看详情，点击【借给TA】，选择担保⼈，输⼊借款⾦额，即可使⽤钱包余额/银⾏卡⽀付；</div>\n                <div class=\"title\" _v-010d07c4=\"\">3、补借条</div>\n                <div _v-010d07c4=\"\">对于已经发⽣的借款，点击⾸⻚下⽅【补借条】，选择您的出借⼈/借款⼈ ⾝份，输⼊借款⾦额、借款⽇期、还款⽇期、年化利率，注明借款⽤途及对⽅姓名，然后发送给对⽅，对⽅在3天内确认即可⽣成电⼦借条；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'出借有什么限制？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div class=\"title\" _v-010d07c4=\"\">出借额度</div>\n                <div _v-010d07c4=\"\">单笔⾦额不超过20万元；</div>\n                <div class=\"title\" _v-010d07c4=\"\">出借次数</div>\n                <div _v-010d07c4=\"\">⽆上限；</div>\n                <div class=\"title\" _v-010d07c4=\"\">费⽤情况</div>\n                <div _v-010d07c4=\"\">年化利率=借款⾦额*(0%-24%),由发起⽅决定；</div>\n                <div _v-010d07c4=\"\">服务费=借款⾦额*（0%/10%/20%）,最低服务费不超过借款⾦额的20%,于出借⼈⽀付成功后，平台直接扣除；</div>\n                <div class=\"title\" _v-010d07c4=\"\">借款时⻓</div>\n                <div _v-010d07c4=\"\">借款时⻓最⻓为1年，分期次数有3/6/12三种选择，补借条⽀持的最早借款时间为2000年1⽉1号；</div>\n                <div class=\"title\" _v-010d07c4=\"\">还款⽅式</div>\n                <div _v-010d07c4=\"\">求借款和贷款⽀持到期还本付息和等额本息两种，补借条仅⽀持到期还本付息；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'有什么⽅法可以帮助我获客？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、今借到为您提供了专业的宣传素材，包括个⼈名⽚、桌贴、店铺挂牌等，点击⾸⻚下⽅的【放贷款】-【下载宣传素材】，即可免费下载使 ⽤；</div>\n                <div _v-010d07c4=\"\">2、您还可以分享贷款产品到各类平台，规范清晰的产品格式可以帮助您建⽴良好的出借⼈形象，提⾼客户转化率；</div>\n                <div _v-010d07c4=\"\">3、完成信⽤认证，专业的信⽤报告可以帮助您快速获得客户的信任；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'如何保证我的客户不流失？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、今借到⽤户只能看到好友的借款标的和贷款产品，这就可以保证您的客户的借款信息不会被公开到全平台，导致客户流失；</div>\n                <div _v-010d07c4=\"\">2、只需关注微信公众号，⽆需下载，⽤户操作简单；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'出借人奖励规则？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <table _v-010d07c4=\"\">\n                    <thead _v-010d07c4=\"\">\n                    <tr _v-010d07c4=\"\"><td _v-010d07c4=\"\">奖励标准梯度</td>\n                    <td _v-010d07c4=\"\">本周成交总单数</td>\n                    <td _v-010d07c4=\"\">本周收取服务费总额</td>\n                    <td _v-010d07c4=\"\">奖励占本周收取服务费总额的比例</td>\n                    </tr></thead>\n                    <tbody _v-010d07c4=\"\"><tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">1</td>\n                        <td _v-010d07c4=\"\">0 - 7</td>\n                        <td _v-010d07c4=\"\">&gt; 0</td>\n                        <td _v-010d07c4=\"\">80%</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">2</td>\n                        <td _v-010d07c4=\"\">&gt; 7</td>\n                        <td _v-010d07c4=\"\">5000元 - 2.5万元</td>\n                        <td _v-010d07c4=\"\">85%</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">3</td>\n                        <td _v-010d07c4=\"\">&gt; 14</td>\n                        <td _v-010d07c4=\"\">2.5万元 - 5万元</td>\n                        <td _v-010d07c4=\"\">90%</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">4</td>\n                        <td _v-010d07c4=\"\">&gt;21</td>\n                        <td _v-010d07c4=\"\">&gt; 5万元</td>\n                        <td _v-010d07c4=\"\">95%</td>\n                    </tr>\n                </tbody></table>\n                <div _v-010d07c4=\"\">周一至周七为一个统计单位，奖励在统计结束后的7个工作日内发送至出借人在平台的账户中</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'关于担保'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'如何在今借到作担保?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">点击⾸⻚的【借款标的】，⽐较并选择适合您的担保标的，查看详情，点击【作担保】，输⼊担保⾦额即可，出借⼈选择您做担保⼈后⽣成借条才算真正担保成功；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'担保有什么限制？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div class=\"title\" _v-010d07c4=\"\">担保条件</div>\n                <div _v-010d07c4=\"\">担保⼈待还⾦额为0时才可以作担保；</div>\n                <div class=\"title\" _v-010d07c4=\"\">担保额度</div>\n                <div _v-010d07c4=\"\">20万</div>\n                <div class=\"title\" _v-010d07c4=\"\">担保次数</div>\n                <div _v-010d07c4=\"\">⽆上限；</div>\n                <div class=\"title\" _v-010d07c4=\"\">费⽤情况</div>\n                <div _v-010d07c4=\"\">担保费=担保⾦额*（0%-10%），由借款 ⼈决定，于出借⼈⽀付成功后直接转到担保⼈平台账户；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'担保⼈有什么义务？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、扩散借款信息，帮找出借⼈；</div>\n                <div _v-010d07c4=\"\">2、借款⼈逾期还款时，替借款⼈还款；</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'电子合同'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'电⼦合同有法律效⼒吗？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">今借到的电⼦合同是受法律保护的，我国《合同法》及电⼦签名法》认可了电⼦合同的有效性。</div>\n                <div _v-010d07c4=\"\">《合同法》第⼗条、⼗⼀条规定：“当事⼈订⽴合同，有 书⾯形式、⼝头形式和其他形式。书⾯形式是指合同书、信件和数据电⽂（包括电报、电传、传真、电⼦数据交换和电⼦邮件）等可以有形地表现所载内容的形式。”根据《电⼦签名法》第四、五、六条的规定：“能够 有形地表现所载内容，并可以随时调取查⽤的数据电⽂，视为符合法律、法规要求的书⾯形式。”</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'充值&amp;提现'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'如何充值/提现，有⼿续费吗？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">点击⾸⻚的【钱包余额】-【充值】/【提现】，输⼊⾦额，验证交 易密码即可，充值⾦额即刻可⽤，提现⾦额T+1个⼯作⽇后到账；</div>\n                <div _v-010d07c4=\"\">充值⼿续费=2.5元/笔（500以上不收费）；</div>\n                <div _v-010d07c4=\"\">提现⼿续费=1元/笔，提现过程中 由平台直接扣除；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'可提现⾦额为什么⼩于钱包余额？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、您有部分钱款还处于在途态，需要银⾏确认到账后才可提现；</div>\n                <div _v-010d07c4=\"\">2、您的收款账户有限额要求；</div>\n                <div class=\"title\" _v-010d07c4=\"\">各类款项的可提现时⻓：</div>\n                <div _v-010d07c4=\"\">借款⾦额 T+1</div>\n                <div _v-010d07c4=\"\">出借⼈奖励 T+7</div>\n                <div _v-010d07c4=\"\">担保费 T+1</div>\n                <div _v-010d07c4=\"\">还款 T+1</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'银⾏卡有⽀付限额吗？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\"></div>\n                <table _v-010d07c4=\"\">\n                    <thead _v-010d07c4=\"\">\n                        <tr _v-010d07c4=\"\"><td _v-010d07c4=\"\">银行名称</td>\n                        <td _v-010d07c4=\"\">单笔充值限额(元)</td>\n                        <td _v-010d07c4=\"\">每月限额(元)</td>\n                    </tr></thead>\n                    <tbody _v-010d07c4=\"\"><tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">北京银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">55000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">招商银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">100000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">工商银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">210000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">光大银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">广发银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">建设银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">280000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">民生银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">农业银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">交通银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">平安银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">浦发银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">上海银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">100000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">兴业银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">华夏银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">邮储银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">中国银行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">长江商业银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">1000000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">武汉农商银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">1000000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">黑龙江农信社</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">1000000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">重庆农商行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">500000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">太仓农商行</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">山东农信银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">1000000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">中信银行</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">无限额</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">甘肃农信社</td>\n                        <td _v-010d07c4=\"\">50000</td>\n                        <td _v-010d07c4=\"\">1000000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">江南农商银行</td>\n                        <td _v-010d07c4=\"\">100000</td>\n                        <td _v-010d07c4=\"\">100000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">农博</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">500000</td>\n                    </tr>\n                    <tr _v-010d07c4=\"\">\n                        <td _v-010d07c4=\"\">吉林农信社</td>\n                        <td _v-010d07c4=\"\">200000</td>\n                        <td _v-010d07c4=\"\">1000000</td>\n                    </tr>\n                </tbody></table>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'收还款&amp;逾期催收'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'如何还款，可以批量/部分/提前还款吗？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">点击⾸⻚上⽅的【待还⾦额】，选择要还款的账单，点击【⻢上还款】，进⾏⽀付即可；</div>\n                <div _v-010d07c4=\"\">其中，补借条产⽣的账单，可以选择线上/线下还 款，求借款和贷款产⽣的账单只能通过线上还款；</div>\n                <div _v-010d07c4=\"\">平台⽀持批量还款，但是批量还款必须全额⽀付，且只要有仅能线上还款的账单必须线上⽀付；</div>\n                <div _v-010d07c4=\"\">平台⽀持单个账单部分还款，即⼀个账单可分多次还款；</div>\n                <div _v-010d07c4=\"\">平台⽀持提前还款，但是利息仍按整期计算，不会减少；</div>\n                <div _v-010d07c4=\"\">补借条线上还款收取还款⼿续费（还款⾦额*5‰）；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'什么是线上/线下还款？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">线上指的是平台内通过钱包余额或绑定的银⾏卡⽀付；</div>\n                <div _v-010d07c4=\"\">线下指的是在平台外通过现⾦/⽀付宝/微信/银⾏卡转账等途径⽀付；</div>\n                <div _v-010d07c4=\"\">线下⽀付需要对⽅确认收到款才⽣效；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'逾期后平台如何处理？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div class=\"title\" _v-010d07c4=\"\">逾期第1天</div>\n                <div _v-010d07c4=\"\">开始推送微信消息提醒借款⼈和担保⼈还款，并上传⾄本平台逾期记录中⼼，所有注册⽤户可查，按⽇计收罚息(逾期本息*0.1%/天)和基础逾期 管理费((逾期本息+罚息)*0.1%/天);</div>\n                <div class=\"title\" _v-010d07c4=\"\">逾期第16天</div>\n                <div _v-010d07c4=\"\">开始向借款⼈和担保⼈及其好友进⾏短信催收，开始计收特别逾期管理费((逾期本息+罚息+基础逾 期管理费)*10%);</div>\n                <div class=\"title\" _v-010d07c4=\"\">逾期第30天</div>\n                <div _v-010d07c4=\"\">特别逾期管理费率上调为15%，短信通知更多好 友，将借款⼈上传⾄平台⿊名单的开放接⼝，并提供诉讼⽀持;</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'信⽤认证'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'信⽤报告有什么作⽤？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、所有⽤户必须实名认证，保证电⼦合同的有效性；</div>\n                <div _v-010d07c4=\"\">2、对于出借⼈⽽⾔，报告提供了详尽的个⼈信⽤信息，可以帮助⻛控，降低⻛险；</div>\n                <div _v-010d07c4=\"\">3、对于借款⼈⽽⾔，信⽤报告可以帮助有效筛选优质出借⼈，完善⾃⼰的信⽤报告也可以⼤⼤提⾼借款效率；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'信⽤报告都包含什么信息？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div class=\"title\" _v-010d07c4=\"\">信⽤报告目前包含三层信息：</div>\n                <div _v-010d07c4=\"\">1、实名认证：绑卡；</div>\n                <div _v-010d07c4=\"\">2、必填信息：基础信息(微信号、居住地址、紧急联系⼈)、授权运营商、授权京东；</div>\n                <div _v-010d07c4=\"\">3、选填信息：学信网、央⾏征信报告、⼯作信息、收⼊证明、⻋产、房产；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'如何保障⽤户隐私？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、在借款⼈逾期前，信⽤报告⾥借款⼈的⾝份证号、⼿机号、具体住址、好友姓名和⼿机号，平台会做脱敏处理；</div>\n                <div _v-010d07c4=\"\">2、平台收集您的信息是出于遵守国家法律法规的规定以及向您提供服务及提升服务质量的⺫的，我们对您的个⼈信息承担保密义务，不会为满⾜第三⽅的营销⺫的⽽向其出售或出租您的任何信息；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'信⽤认证需要付费吗？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">信⽤认证费：9.9元/⼈次，⽤于更新信⽤报告时，⽀付给 第三⽅数据公司，⼀次认证有效期为1个⽉，超过1个⽉需重新认证，只有信⽤认证过后才可以正常使⽤求借款/补借条/申请贷款/放贷款等功能；</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'诈骗&amp;举报'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'何种情况可以举报?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">出借⼈没有按照借条规定全额出借；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'如何举报?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">通过⾸⻚的【待还⾦额】或点击头像-【借⼊】，进⼊借条详情，点击屏幕下⽅【违规举报】，然后上传真实充⾜的证据以证明出借⼈确实没有全额出借，恶意违规即可，证据可以多次补充；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'处理流程?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、借款⼈上传证据，举报；</div>\n                <div _v-010d07c4=\"\">2、通知出借⼈72⼩时内上传证据，为 ⾃⼰辩护；</div>\n                <div _v-010d07c4=\"\">3、72⼩时后，平台会根据双⽅的证据 及平台的举报处理标准，做出驳回举报/借条置为有争议等处理</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'有争议是什么意思?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">有争议仅表⽰本平台对该借条的成⽴条件持怀疑态度，这只是平台为了维护良好的秩序⽽采取的有效措施，如果您对处理结果有任何异议，仍然可以向平台或者法院申诉；</div>\n                <div _v-010d07c4=\"\">有争议的借条不会产⽣逾期记录，不会对借款⼈的信⽤产⽣影响；</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'⼿机号&amp;验证码&amp;交易密码'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'注册时收不到验证码怎么办?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">1、如果收不到短信验证码，可以尝试点击⻚⾯下⽅的【获取语⾳验证码】；</div>\n                <div _v-010d07c4=\"\">2、如果语⾳验证码也收不到，请联系客服010-52497911，为 您⼈⼯提供验证码；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'换了⼿机号怎么办?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">点击⾸⻚左上⾓的头像，进⼊【我的】，点击【设置】，可以更换⼿机号；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'忘记交易密码怎么办?'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">点击⾸⻚左上⾓的头像，进⼊【我的】，点击【设置】，可以修改交易密码；</div>\n            </div>\n        </accordion>\n        <accordion :text=\"'换了微信怎么办？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">您可以在新的微信⾥⾯⽤之前的⼿机号重新注册⼀遍，会需要再绑⼀次卡，但是数据不会丢失；</div>\n            </div>\n        </accordion>\n    </accordion>\n    <accordion :min=\"false\" :text=\"'关于好友'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n        <accordion :text=\"'如何确认平台好友关系？'\" :img-show=\"false\" :show-ele=\"false\" _v-010d07c4=\"\">\n            <div class=\"content\" _v-010d07c4=\"\">\n                <div _v-010d07c4=\"\">查看过对⽅的借款标的/借条详情/贷款产品，就 ⾃动成为好友，可以点击⾸⻚左上⾓的头像，进⼊【我的】，点击【好友】查看我的全部好友；</div>\n            </div>\n        </accordion>\n    </accordion>\n</div>\n";

